```
use hashbrown::HashMap;

let mut map: HashMap<_, _> = [(1, "One".to_owned()), (2, "Two".into())].into();

let mut iter = map.iter_mut();
iter.next().map(|(_, v)| v.push_str(" Mississippi"));
