1203.docs:
Attempts to get mutable references to `N` values in the map at once, without validating that
the values are unique.

The `eq` argument should be a closure such that `eq(i, k)` returns true if `k` is equal to
the `i`th key to be looked up.

Returns an array of length `N` with the results of each query. `None` will be returned if
any of the keys are missing.

For a safe alternative see [`get_many_mut`](`HashTable::get_many_mut`).

# Safety

Calling this method with overlapping keys is *[undefined behavior]* even if the resulting
references are not used.

[undefined behavior]: https://doc.rust-lang.org/reference/behavior-considered-undefined.html

# Examples

```
# #[cfg(feature = "nightly")]
# fn test() {
use hashbrown::hash_table::Entry;
use hashbrown::{HashTable, DefaultHashBuilder};
use std::hash::BuildHasher;

let mut libraries: HashTable<(&str, u32)> = HashTable::new();
let hasher = DefaultHashBuilder::default();
let hasher = |val: &_| hasher.hash_one(val);
for (k, v) in [
    ("Bodleian Library", 1602),
    ("Athenum", 1807),
    ("Herzogin-Anna-Amalia-Bibliothek", 1691),
    ("Library of Congress", 1800),
] {
    libraries.insert_unique(hasher(&k), (k, v), |(k, _)| hasher(&k));
}

let keys = ["Athenum", "Library of Congress"];
let got = libraries.get_many_mut(keys.map(|k| hasher(&k)), |i, val| keys[i] == val.0);
assert_eq!(
    got,
    [Some(&mut ("Athenum", 1807)), Some(&mut ("Library of Congress", 1800))],
);

// Missing keys result in None
let keys = ["Athenum", "New York Public Library"];
let got = libraries.get_many_mut(keys.map(|k| hasher(&k)), |i, val| keys[i] == val.0);
assert_eq!(got, [Some(&mut ("Athenum", 1807)), None]);
# }
# fn main() {
#     #[cfg(feature = "nightly")]
#     test()
# }
```

45.docs:
Clears the map, returning all key-value pairs as an iterator. Keeps the
allocated memory for reuse.

If the returned iterator is dropped before being fully consumed, it
drops the remaining key-value pairs. The returned iterator keeps a
mutable borrow on the vector to optimize its implementation.

# Examples

```
use hashbrown::HashMap;

let mut a = HashMap::new();
a.insert(1, "a");
a.insert(2, "b");
let capacity_before_drain = a.capacity();

for (k, v) in a.drain().take(1) {
    assert!(k == 1 || k == 2);
    assert!(v == "a" || v == "b");
}

// As we can see, the map is empty and contains no element.
assert!(a.is_empty() && a.len() == 0);
// But map capacity is equal to old one.
assert_eq!(a.capacity(), capacity_before_drain);

let mut a = HashMap::new();
a.insert(1, "a");
a.insert(2, "b");

{   // Iterator is dropped without being consumed.
    let d = a.drain();
}

// But the map is empty even if we do not use Drain iterator.
assert!(a.is_empty());
```

